import React from 'react';
import './blogPage.css';
import blogBackground from '../../assets/Blog_Page.gif';

const BlogPage = () => {
  return (
    <div className='blogPage'>
      <h1>Mag<span>net</span></h1>
      <img src={blogBackground} alt='err404'></img>
    </div>
  )
}

export default BlogPage
